import React from 'react'

class Ranking extends React.Component{

    state = {
        rankingList: []
    }

    componentDidMount = () => {
        fetch("/api/ranking")
            .then(res =>  res.json())
            .then(data => {
                const a = Object.keys(data).map(function(key) {
                    return [key, data[key]];
                });
                console.log(typeof a)
                this.setState({rankingList: a})
            })
            .catch(e => {
                console.error(e)
            })
        } 

    render(){
        const rankingList = this.state.rankingList
        return (
            <div>
                <ul>
                {rankingList.length > 0 && rankingList.map(ranking => {
                    return <li>{ranking}</li>
                })}
                </ul>
            </div>
        )
    }
}

export default Ranking
